# Part 1
def react(polymer):
    i = 0

    while i < len(polymer) - 1:
        if polymer[i].upper() == polymer[i + 1].upper() and (
                polymer[i].islower()
                and polymer[i + 1].isupper()
                or polymer[i].isupper()
                and polymer[i + 1].islower()
        ):
            polymer = polymer[:i] + polymer[i + 2:]
            if i > 0:
                i -= 1
        else:
            i += 1
    return len(polymer)

print(react(data))

# Part 2
alpha = [chr(i) for i in range(65, 91)]

letter = None
most_reduced = len(data)

for a in alpha:
    s = data[:].replace(a, "").replace(a.lower(), "")
    ans = react(s)
    if ans < most_reduced:
        most_reduced = ans
        letter = a

print(letter)
print(most_reduced)

